import React from "react";


const Wikis = () => {
    return (
        <Container>
            <Row className="mt-2"> 
                <Col md = {3}>
                    <TypeBar/>
                </Col>
                <Col md = {9}>
                    <BrandBar/>
                    <DeviceList/>
                    <Pages/>
                </Col>
            </Row>
        </Container>
    );
};

export default Wikis;
